import React from 'react';
// import './App.css';
import { BrowserRouter as Router, Route } from "react-router-dom";
import NewsDashboard from './services/news/newsDashboard'
import MainPage from './mainPage';
import Dictionary from './services/dictionary';
import Home from './services/corona/Home'
import Stats from './services/corona/Stats'
import Map from './services/corona/Map'
import NavBar from './services/corona/NavBar';
import weatherMain from './services/weather/weatherMain';
// import mainSpacex from './services/spacex/client/src/mainSpacex';
import Launches from './services/spacex/client/src/components/Launches';


import ApolloClient from "apollo-boost";
import { ApolloProvider } from "react-apollo";


import "./services/spacex/client/src/thestyles.css";


import Logo from './services/spacex/client/src/spacex.png'

import Launch from "./services/spacex/client/src/components/Launch";

const client = new ApolloClient({
  uri: process.env.REACT_APP_GRAPHQL_API,
});


function App() {


  return (
    <div className="App">
      <Router>
        <div>
          <MainPage />
          <Route path="/covid/*" component={NavBar} />
        </div>
        <Route exact path="/news" component={NewsDashboard} />
        <Route path="/dictionary" component={Dictionary} />
        <Route path="/covid/Home" component={Home} />
        <Route path="/covid/Stats" component={Stats} />
        <Route path="/covid/Map" component={Map} />
        <Route path="/weather" component={weatherMain} />
        <ApolloProvider client={client}>

          <div className="container">
            <img className="logo" src={Logo} alt="SpaceX" />
            <Route path="/spacex" component={Launches} />
            <Route path="/spacex/launch/:flight_number" component={Launch} />
          </div>

        </ApolloProvider>
      </Router>
    </div>
  );
}

export default App;
